    CreateEmployee,
    FetchEmployee,
    UpdateEmployee,
    DeleteEmployee
} from "../controller/employee.controller";


import express from "express";
const router = express.Router();


router.post("/create-employee",CreateEmployee);
router.get("/fetch-employee",FetchEmployee);
